// import logo from './logo.svg';
import React from "react";
import './App.css';
import Home from './home';
import CourseOne from "./course-one";
import CourseTwo from "./course-two";
import Contact from "./contact";
import { Route, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Routes exact path="/" component={Home} />
      <Routes exact path="/courseone" component={CourseOne} />
      <Routes exact path="/coursetwo" component={CourseTwo} />
      <Routes exact path="/contact" component={Contact} />
    </div>
  );
}

export default App;
